import { shopColumns, coachColumns, priceConfigColumns } from "./info#table.config";
import { InfoService } from "./info.service";
import { AppConfig } from '@/constants/config';
import { TRANSFER_UNIT } from '@/constants/course/personal';
export default {
  name: 'PersonalInfo',
  serviceInject: function serviceInject() {
    return {
      config: AppConfig,
      infoService: InfoService
    };
  },
  rxState: function rxState() {
    return {
      personalCourseInfo: this.infoService.personalCourseInfo$
    };
  },
  computed: {
    coachColumns: coachColumns,
    prices: function prices() {
      var arr = [];
      this.personalCourseInfo.price_gradient.forEach(function (item) {
        item.prices.forEach(function (ele) {
          arr.push(ele);
        });
      });
      return arr;
    },
    image: function image() {
      return this.personalCourseInfo.image.image_key;
    },
    saleModel: function saleModel() {
      return this.personalCourseInfo.sale_model === 1; // 教练谈单
    }
  },
  data: function data() {
    return {
      shopColumns: shopColumns,
      priceConfigColumns: priceConfigColumns,
      TRANSFER_UNIT: TRANSFER_UNIT
    };
  }
};
